import React from 'react'

function Footer(){
    return (
        <Footer>
            <a
                href="https://www.facebook.com/profile.php?id=100005252533465" target="_blank"
            >
                <img
                    src={`${process.env.PUBLIC_URL}/face-logo.jpg`}
                    alt="facebook-icon"
                />
            </a>
        </Footer>
    )
}

export default Footer;
